  05> HUTTON, Keith m on 20.10.1984 to (2)CROSBIE, Gayleen
  b 31.05.1958
  Keith is a caterer.
  ** ****
  04> HUTTON, Edward Michael
  b 24.01.1857 d 15.04.1872
  Edward b. at Hutt and d. at Pakaraka. According to the headstone in the Pakaraka churchyard, Edward was killed
  by the 'accidental discharge of a firearm'.
  05> HUTTON, Marianne Elizabeth Georgina m on 04.03.1887 to KEMP, Francis James
  (Bessie)
  b 18.02.1860 d 21.03.1950
  b 08.08.1855 d 17.08.1923
  Marianne b. at Paihia and bd. at Takapuna, Francis b, at Kerikeri and bd, at Takapuna.
  Francis managed "Matahiia" Station, an 8,000 acre property at Ruatoria which he cleared and grassed. He
  acquired "Rotokautuku" in 1893 and "Rukuhanga" in 1909.
  Bessie and Francis retired to live at Takapuna in 1920.
  Rotokautuku
  In 1893 Francis James Kemp took up the "Rotokautuku" block at Ruatoria. It comprised 1,596 acres leased at 1/6
  per acre, plus some freehold. The lease was renewed for a further 21 years at 5/- per acre. On the retirement
  of FJ Kemp the property passed to Ralph Kemp and Athol Lewis Kemp who farmed it in partnership for a time,
  then divided it into two separate units,
  Rukuhanga
  In 1909 Francis James Kemp took up a block of 1,532 acres of virgin bush land near Cape Runaway about 80 miles
  north-east of Opotiki. His two sons, Alfred Ernest Kemp and Hayward Francis Kemp, with the help of their
  cousin, AJ W Kemp, cleared the bush and drained and swamp-ploughed a 200 acre block which they used to produce
  crops of rape, maize and turnips. They established a herd of Aberdeen cattle from stock from HB Williams'
  "Turihaua" stud and also a Romney flock from the stud of Sir Edwin Mitchelson and later from the Patutahi Stud
  of Mr A Kirkpatrick of Gisborne.
  "Rukuhanga" was freeholded about 1922 and in 1950 H F Kemp, having no children, sold his share to his nephew,
  Frank James Kemp. The property is now owned and farmed by Frank's son, James Ernest Kemp.
  01> KEMP, Alfred Ernest m on 14.11.1923 to MAY, Dory
  b 13.01.1888 d 23.11.1974
  b 22.05.1892 d 10.08.1970
  Ernest b, at Matahiia, d, at Whangarei and bd, at St James' Church, Kerikeri. He was educated at Wanganui
  Collegiate School and served in the 9th Mtd Rifles during WW1. He farmed at Cape Runaway for many years and
  was a member of the Matakaoa County Council at its inception in 1920, serving as chairman for 22 years.
  Later he and Dory lived at Kerikeri where he owned and cared for the old Mission House. He and his son,
  Frank, presented the house and section to the nation. Ernest was a Vicar's warden and synodsman in St
  James' Church. He was also active in the Kerikeri Scout Movement, an honorary member of the Acclimatisation
  Society and a Justice of the Peace. He was awarded a Queen's Coronation Medal and a Conservation Council
  Award.
  01> KEMP, Frank James m on 04.06.1955 to HALL, Alma
  b 01.11.1924 d 12.06.1986
  b 13.10.1921
  Frank b, at Cape Runaway, m. at Timaru and bd. at Cape Runaway. Alma, d/o John James Hall and Gertrude
  Grace Bowden Paterson. Address: 30 Sedgewick Road, Opotiki.
  Frank was a farmer and Alma was a registered nurse. Frank served in the RNZ Navy during WW2.
  01> KEMP, Elizabeth Ann
  b 08.10.1956
  Elizabeth b, at Gisborne. Address: 17/43 The Strand, Townsville 4810, Qid, Australia.
